class Solution(object):
    def strStr(self, haystack, needle):
        """
        :type haystack: str
        :type needle: str
        :rtype: int
        """
        if len(needle) == 0:
            return 0
        if len(needle) > len(haystack):
            return -1

        i = 0
        l = 0
        present = []
        while i < len(haystack):
            if needle[0] == haystack[i]:
                present.append(i)
            i = i + 1

        if not present:
            return

        for k in present:
            for j in range(k, len(haystack)):
                if needle[l] != haystack[j]:
                    l = 0
                    break
                if l == len(needle) - 1:
                    return k
                l += 1
        return -1


if __name__ == '__main__':
    soln = Solution()
